og().modeljsonschema("choice"); assertnotnull (schema); @test public void testjsonschema throw exception string schema catalog .modeljsonschema("aggregate"); assertnotnull (schema); let make possible find bean /method using name schema catalog .modeljsonschema("method"); assertnotnull (schema); schema catalog .modeljsonschema("bean"); assertnotnull (schema); @test public void testasendpointurimapfile throw exception map <string, string map new hashmap <string, string map .put("directoryname", "src/data/inbox"); map .put("noop", "true"); map .put("delay", string uri catalog .asendpointuri("file", map true assertequals ("file:src/data/inbox?delay=5000&noop=true", uri string uri2 catalog .asendpointurixml("file", map true assertequals ("file:src/data/inbox?delay=5000&amp;noop=true", uri2 @test public void testasendpointuritimer throw exception map <string, string map new hashmap <string, string map .put("timername", "foo"); map .put("period", string uri catalog .asendpointuri("timer", map true assertequals ("timer:foo?period=5000", uri @test public void testasendpointuripropertiesplaceholders throw exception map <string, string map new hashmap <string, string map .put("timername", "foo"); map .put("period", "{{howoften}}"); map .put("repeatcount", string uri catalog .asendpointuri("timer", map true assertequals ("timer:foo?period=%7b%7bhowoften%7d%7d&repeatcount=5", uri uri catalog .asendpointuri("timer", map false assertequals ("timer:foo?period={{howoften}}&repeatcount=5", uri @test public void testasendpointuribeanlookup throw exception map <string, string map new hashmap <string, string map .put("resourceuri", "foo.xslt"); map .put("converter", "#myconverter"); string uri catalog .asendpointuri("xslt", map true assertequals ("xslt:foo.xslt?converter=%23myconverter", uri uri catalog .asendpointuri("xslt", map false assertequals ("xslt:foo.xslt?converter=#myconverter", uri @test public void testendpointpropertiesplaceholders throw exception map <string, string map catalog .endpointproperties("timer:foo?period={{howoften}}&repeatcount=5"); assertnotnull (map); assertequals map .size()); assertequals ("foo", map .get("timername")); assertequals ("{{howoften}}", map .get("period")); assertequals map .get("repeatcount")); @test public void testasendpointurilog throw exception map <string, string map new hashmap <string, string map .put("loggername", "foo"); map .put("loggerlevel", "warn"); map .put("multiline", "true"); map .put("showall", "true"); map .put("showbody", "false"); map .put("showbodytype", "false"); map .put("showexchangepattern", "false"); map .put("style", "tab"); assertequals ("log:foo?loggerlevel=warn&multiline=true&showall=true&style=tab", catalog .asendpointuri("log", map false @test public void testasendpointurilogshort throw exception map <string, string map new hashmap <string, string map .put("loggername", "foo"); map .put("loggerlevel", "debug"); assertequals ("log:foo?loggerlevel=debug", catalog .asendpointuri("log", map false @test public void testasendpointuriwithplaceholder throw exception map <string, string map new hashmap <string, string map .put("name", "foo"); map .put("blockwhenfull", "{{block}}"); assertequals ("seda:foo?blockwhenfull={{block}}", catalog .asendpointuri("seda", map false @test public void testendpointpropertiessedarequired throw exception map <string, string map catalog .endpointproperties("seda:foo"); assertnotnull (map); assertequals map .size()); assertequals ("foo", map .get("name")); map catalog .endpointproperties("seda:foo?blockwhenfull=true"); assertnotnull (map); assertequals map .size()); assertequals ("foo", map .get("name")); assertequals ("true", map .get("blockwhenfull")); @test public void validateproperties throw exception valid endpointvalidationresult result catalog .validateendpointproperties("log:mylog"); asserttrue (result.issuccess()); unknown result catalog .validateendpointproperties("log:mylog?level=warn&foo=bar"); assertfalse (result.issuccess()); asserttrue (result.getunknown().contains("foo")); assertequals result .getnumberoferrors()); enum result catalog .validateendpointproperties("seda:foo?waitfortasktocomplete=blah"); assertfalse (result.issuccess()); assertequals ("blah", result .getinvalidenum().get("waitfortasktocomplete")); assertequals result .getnumberoferrors()); reference okay result catalog .validateendpointproperties("seda:foo?queue=#queue"); asserttrue (result.issuccess()); assertequals result .getnumberoferrors()); unknown component result catalog .validateendpointproperties("foo:bar?me=you"); assertfalse (result.issuccess()); asserttrue (result.getunknowncomponent().equals("foo")); assertequals result .getnumberoferrors()); invalid boolean default value result catalog .validateendpointproperties("log:output?showall=ggg"); assertfalse (result.issuccess()); assertequals ("ggg", result .getinvalidboolean().get("showall")); assertequals result .getnumberoferrors()); dataset result catalog .validateendpointproperties("dataset:foo?minrate=50"); asserttrue (result.issuccess()); time pattern result catalog .validateendpointproperties("timer://foo?fixedrate=true&delay=0&period=2s"); asserttrue (result.issuccess()); reference lookup result catalog .validateendpointproperties("timer://foo?fixedrate=#fixed&delay=#mydelay"); asserttrue (result.issuccess()); optional consumer prefix result catalog .validateendpointproperties("file:inbox?consumer.delay=5000&consumer.greedy=true"); asserttrue (result.issuccess()); optional without consumer prefix result catalog .validateendpointproperties("file:inbox?delay=5000&greedy=true"); asserttrue (result.issuccess()); mixed optional without consumer prefix result catalog .validateendpointproperties("file:inbox?delay=5000&consumer.greedy=true"); asserttrue (result.issuccess()); prefix result catalog .validateendpointproperties("file:inbox?delay=5000&scheduler.foo=123&scheduler.bar=456"); asserttrue (result.issuccess()); stub result catalog .validateendpointproperties("stub:foo?me=123&you=456"); asserttrue (result.issuccess()); lenient result catalog .validateendpointproperties("dataformat:string:marshal?foo=bar"); asserttrue (result.issuccess()); lenient result catalog .validateendpointproperties("dataformat:string:marshal?foo=bar", true assertfalse (result.issuccess()); asserttrue (result.getunknown().contains("foo")); data format result catalog .validateendpointproperties("dataformat:string:marshal?charset=utf-8", true asserttrue (result.issuccess()); incapable parse result catalog .validateendpointproperties("{{getftpurl}}?recursive=true"); assertfalse (result.issuccess()); asserttrue (result.getincapable() null @test public void validatepropertiessummary throw exception endpointvalidationresult result catalog .validateendpointproperties("yammer:messages?blah=yada&accesstoken=aaa&consumerkey=&usejson=no&initialdelay=five&pollstrategy=mystrategy"); assertfalse (result.issuccess()); string reason result .summaryerrormessage(true); log .info(reason); result catalog .validateendpointproperties("jms:unknown:myqueue"); assertfalse (result.issuccess()); reason result .summaryerrormessage(false); log .info(reason); @test public void validatetimepattern throw exception asserttrue (catalog.validatetimepattern("0")); asserttrue (catalog.validatetimepattern("500")); asserttrue (catalog.validatetimepattern("10000")); asserttrue (catalog.validatetimepattern("5s")); asserttrue (catalog.validatetimepattern("5sec")); asserttrue (catalog.validatetimepattern("5secs")); asserttrue (catalog.validatetimepattern("3m")); asserttrue (catalog.validatetimepattern("3min")); asserttrue (catalog.validatetimepattern("3minutes")); asserttrue (catalog.validatetimepattern("5m15s")); asserttrue (catalog.validatetimepattern("1h")); asserttrue (catalog.validatetimepattern("1hour")); asserttrue (catalog.validatetimepattern("2hours")); assertfalse (catalog.validatetimepattern("bla")); assertfalse (catalog.validatetimepattern("2year")); assertfalse (catalog.validatetimepattern("60darn")); @test public void testendpointcomponentname throw exception string name catalog .endpointcomponentname("jms:queue:foo"); assertequals ("jms", name @test public void testsimpleexpression throw exception simplevalidationresult result catalog .validatesimpleexpression(null, "${body}"); asserttrue (result.issuccess()); assertequals ("${body}", result .getsimple()); result catalog .validatesimpleexpression(null, "${body"); assertfalse (result.issuccess()); assertequals ("${body", result .getsimple()); log .info(result.geterror()); asserttrue (result.geterror().startswith("expected symbol functionend eol location assertequals ("expected symbol functionend eol result .getshorterror()); assertequals result .getindex()); @test public void testsimplepredicate throw exception simplevalidationresult result catalog .validatesimplepredicate(null, "${body} 'abc'"); asserttrue (result.issuccess()); assertequals ("${body} 'abc'", result .getsimple()); result catalog .validatesimplepredicate(null, "${body} ${header.size"); assertfalse (result.issuccess()); assertequals ("${body} ${header.size", result .getsimple()); log .info(result.geterror()); asserttrue (result.geterror().startswith("expected symbol functionend eol location assertequals ("expected symbol functionend eol result .getshorterror()); assertequals result .getindex()); @test public void testsimplepredicateplaceholder throw exception simplevalidationresult result catalog .validatesimplepredicate(null, "${body} contains '{{danger}}'"); asserttrue (result.issuccess()); assertequals ("${body} contains '{{danger}}'", result .getsimple()); result catalog .validatesimplepredicate(null, "${bdy} contains '{{danger}}'"); assertfalse (result.issuccess()); assertequals ("${bdy} contains '{{danger}}'", result .getsimple()); log .info(result.geterror()); asserttrue (result.geterror().startswith("unknown function bdy location asserttrue (result.geterror().contains("'{{danger}}'")); assertequals ("unknown function bdy result .getshorterror()); assertequals result .getindex()); @test public void testvalidatelanguage throw exception languagevalidationresult result catalog .validatelanguageexpression(null, "simple", "${body}"); asserttrue (result.issuccess()); assertequals ("${body}", result .gettext()); result catalog .validatelanguageexpression(null, "header", "foo"); asserttrue (result.issuccess()); assertequals ("foo", result .gettext()); result catalog .validatelanguagepredicate(null, "simple", "${body} asserttrue (result.issuccess()); assertequals ("${body} result .gettext()); result catalog .validatelanguagepredicate(null, "header", "bar"); asserttrue (result.issuccess()); assertequals ("bar", result .gettext()); result catalog .validatelanguagepredicate(null, "foobar", "bar"); assertfalse (result.issuccess()); assertequals ("unknown language foobar result .geterror()); @test public void testvalidateendpointconsumeronly throw exception string uri "file:inbox?buffersize=4096&readlock=changed&delete=true"; endpointvalidationresult result catalog .validateendpointproperties(uri, false true false asserttrue (result.issuccess()); uri "file:inbox?buffersize=4096&readlock=changed&delete=true&fileexist=append"; result catalog .validateendpointproperties(uri, false true false assertfalse (result.issuccess()); assertequals ("fileexist", result .getnotconsumeronly().iterator().next()); @test public void testvalidateendpointproduceronly throw exception string uri "file:outbox?buffersize=4096&fileexist=append"; endpointvalidationresult result catalog .validateendpointproperties(uri, false false true asserttrue (result.issuccess()); uri "file:outbox?buffersize=4096&fileexist=append&delete=true"; result catalog .validateendpointproperties(uri, false false true assertfalse (result.issuccess()); assertequals ("delete", result .getnotproduceronly().iterator().next());
